[`AsyncBufRead`]: tokio::io::AsyncBufRead
[`Stream`]: futures_core::Stream
[`ReaderStream`]: crate::io::ReaderStream
[`StreamExt`]: https://docs.rs/tokio-stream/latest/tokio_stream/trait.StreamExt.html

